  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Cabeza Prieta NWR for the next 15 years. This
  plan outlines the Refuge vision and purpose and describes how Cabeza Prieta NWR
  will contribute to the overall mission of the Refuge System. The plan provides an
  introduction to the Refuge, an overview of the CCP process, management alternatives,
  the affected environment, and environmental consequences. Key planning issues include:
  wildlife and habitat management, endangered species, desert bighorn sheep management,
  predator management, visitor services, and public use.\",\n\t\"license_title\":
